original_question:
Trikampis $ABC$ yra lygiašonis, su $AB=AC$ ir aukštine $AM=11.$ Tarkime, kad yra taškas $D$ ant $\overline{AM}$ su $AD=10$ ir $\angle BDC=3\angle BAC.$ Raskite trikampio $ABC$ perimetrą.

[asy]
unitsize(0.4 cm);

pair A, B, C, D, M;

A = (0,11);
D = (0,1);
B = (-11/2,0);
C = (11/2,0);
M = (B + C)/2;

draw(A--B--C--cycle);
draw(A--M);
draw(B--D--C);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, NW);
label("$M$", M, S);
[/asy]

