original_question:
Stačiakampis laukas yra aptvertas sporto taku, kaip parodyta žemiau. Takas susideda iš dviejų lauko kraštų ir dviejų puslankių. Tako ilgis yra 400 metrų. Kokia yra didžiausia galima lauko plotas kvadratiniais metrais?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
